 "description": "Extension is synchronized from the Repository. An extension can contain multiple versions.",
 "properties": {
  "spec": {
   "description": "ExtensionSpec only contains basic extension information copied from the latest ExtensionVersion.",
   "properties": {
    "created": {
     "format": "date-time",
     "type": "string"
    },
    "description": {
     "additionalProperties": {
      "type": "string"
     },
     "type": "object"
    },
    "displayName": {
     "additionalProperties": {
      "type": "string"
     },
     "type": "object"
    },
    "icon": {
     "type": "string"
    },
    "provider": {
     "additionalProperties": {
      "description": "Provider describes an extension provider.",
      "properties": {
       "email": {
        "description": "Email is an optional email address to contact the named provider",
        "type": "string"
       },
       "name": {
        "description": "Name is a username or organization name",
        "type": "string"
       },
       "url": {
        "description": "URL is an optional URL to an address for the named provider",
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "object"
    }
   },
   "type": "object"
  }
 },
